import {
    Container,
    ProfilePicture
} from './styles';

const UserPicture = props => (
    <Container>
        <ProfilePicture src={props.url} alt={props.alternativeText} />
        <a href={props.html_url}></a>
    </Container>
);

export default UserPicture;
